pub fn get_starrocks_root_grammar_id() -> GrammarId {
    GrammarId(2254)
}
pub fn get_starrocks_root_grammar_table() -> RootGrammar {
    RootGrammar::TableDriven {
        grammar_id: get_starrocks_root_grammar_id(),
        tables: &STARROCKS_TABLES,
    }
}
pub fn get_starrocks_root_grammar() -> RootGrammar {
    get_starrocks_root_grammar_table()
}
